import React from 'react';
import logo from "./Images/logo.png";

 const Header = () => {
  return (
    <>
      <div className="header">
        <img src={logo} alt="logo" width='70' height='60' />
        <h1> Rishabh NoteMaking</h1>
      </div>
    </>
  );
};
export default Header;
